script: |
  super -f text -I q5656.spq | sort > q5656.out

inputs:
  - name: q5656.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT + + 71 IN ( + + 24 + col2, 62 * - col2, + 0 * - col2, - col0, + 11 + + col1 / - col2 );
  - name: tab0

outputs:
  - name: q5656.out
    data: |
      87	21	10
      97	1	99
